import React from "react";
import ReactDom from "react-dom";

function Footer()
{
    const date = new Date().getFullYear();
    ReactDom.render(
        <footer>
            <p>copyright {date}</p>
        </footer>,
        document.getElementById("root"));
}

export default Footer;
